import React, { useEffect, useState } from "react";
import {
  Container,
  Typography,
  Paper,
  Box,
  Button,
  Avatar,
  Grid,
  CircularProgress,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from "@mui/material";
import { orange } from "@mui/material/colors";
import axios from "axios";

const UserProfile = () => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const response = await axios.get("http://localhost:8080/user/profile", {
          headers: { Authorization: `Bearer ${sessionStorage.getItem("token")}` },
        });
        setUser(response.data);
      } catch (error) {
        console.error("Error fetching user profile", error);
      } finally {
        setLoading(false);
      }
    };
    fetchUser();
  }, []);

  if (loading) return <CircularProgress sx={{ display: "block", mx: "auto", mt: 5, color: orange[500] }} />;

  return (
    <Container maxWidth="md" sx={{ mt: 5 }}>
      <Paper elevation={3} sx={{ p: 4, bgcolor: orange[50] }}>
        <Grid container spacing={3} alignItems="center">
          <Grid item xs={12} md={4} textAlign="center">
            <Avatar sx={{ width: 80, height: 80, mx: "auto", bgcolor: orange[500] }}>U</Avatar>
            <Typography variant="h6" sx={{ mt: 1, color: orange[800] }}>{user?.name || "User"}</Typography>
            <Typography variant="body2" color="text.secondary">Learner</Typography>
          </Grid>
          <Grid item xs={12} md={8}>
            <Box>
              <Typography variant="h6" sx={{ color: orange[700] }}>Personal Details</Typography>
              <Typography>Name: {user?.name || "N/A"}</Typography>
              <Typography>Email: {user?.email || "N/A"}</Typography>
              <Typography>DOB: {user?.dob || "1900-01-01"}</Typography>
              <Button variant="contained" sx={{ mt: 2, bgcolor: orange[500], '&:hover': { bgcolor: orange[700] } }}>Edit Profile</Button>
            </Box>
          </Grid>
        </Grid>
        <Box sx={{ mt: 4 }}>
          <Typography variant="h6" sx={{ color: orange[700] }}>Recent Activities</Typography>
          <TableContainer component={Paper} sx={{ bgcolor: orange[50] }}>
            <Table>
              <TableHead>
                <TableRow sx={{ bgcolor: orange[100] }}>
                  <TableCell>#</TableCell>
                  <TableCell>Type</TableCell>
                  <TableCell>Time</TableCell>
                  <TableCell>IP</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {user?.activities?.map((activity, index) => (
                  <TableRow key={index}>
                    <TableCell>{index + 1}</TableCell>
                    <TableCell>{activity.type}</TableCell>
                    <TableCell>{activity.time}</TableCell>
                    <TableCell>{activity.ip}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Box>
      </Paper>
    </Container>
  );
};

export default UserProfile;
